import React from "react";
import { TwitterTimelineEmbed } from "react-twitter-embed";
import InstagramEmbed from "react-instagram-embed";
const News = () => {
  return (
    <section className="news ">
      <div className="row">
        <div className="col-md-6 px-0">
          <div className="news__twitter-img">
          
          </div>
        </div>
        <div className="col-md-6 py-5 px-0">
          <div className="news__twitter-timline">
            <TwitterTimelineEmbed
              sourceType="profile"
              screenName="saradiqsa"
              options={{
                height: "400",
              }}
              theme="light"
              noHeader="true"
              noBorders="true"
              noFooter="true"
            ></TwitterTimelineEmbed>
          </div>
        </div>
      </div>
      <div className="row">
        <div className="col-md-6 py-5 px-0">
          <div className="news__twitter-timline">
            <TwitterTimelineEmbed
              sourceType="profile"
              screenName="saradiqsa"
              options={{
                height: "400",
              }}
              theme="light"
              noHeader="true"
              noBorders="true"
              noFooter="true"
            ></TwitterTimelineEmbed>
          </div>
        </div>
        <div className="col-md-6 px-0">
          <div className="news__twitter-img"></div>
        </div>
      </div>
    </section>
  );
};

export default News;

